IF NOT EXISTS (SELECT * FROM sysobjects WHERE name = 'Resources' AND xtype = 'U')
BEGIN
	CREATE TABLE [dbo].[Resources](
		[Id] [INT] IDENTITY(1,1) NOT NULL,
		[Culture] [VARCHAR](10) NOT NULL,
		[Name] [VARCHAR](50) NULL,
		[IsEntity] [BIT] NOT NULL,
		[EntityName] [VARCHAR](100) NULL,
		[ColumName] [VARCHAR](100) NULL,
		[RowCodeId] [VARCHAR](100) NULL,
		[Value] [VARCHAR](MAX) NOT NULL,
		[Type] [VARCHAR](50) NULL,
	CONSTRAINT [PK_Resource] PRIMARY KEY CLUSTERED (
		[Id] ASC
	)
	WITH (
		PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON, FILLFACTOR = 100
	)
	ON [PRIMARY]
) ON [PRIMARY] TEXTIMAGE_ON [PRIMARY]
END
GO

