CREATE PROCEDURE [dbo].[Report_Sp_GetResByFilter]
@Culture nvarchar(10)
WITH 
EXECUTE AS CALLER
AS
BEGIN
	SET NOCOUNT ON;

    SELECT  [Name] ,[Value]

FROM dbo.[Resources] AS PAG
WHERE 
	 ([Culture] like @Culture)
	and (isEntity = 0)
	 
END
GO

IF object_id('[dbo].[Resources_Sp_Delete]') IS NOT NULL
	DROP PROCEDURE [dbo].[Resources_Sp_Delete]
GO

CREATE PROCEDURE [dbo].[Resources_Sp_Delete]
( 
@Id int = null, @lstId varchar(MAX) = null

)
AS
SET NOCOUNT ON;
DELETE FROM dbo.[Resources] 
WHERE  
    
    ((not @Id is null 
        and [Id] = @Id)
   or (not @lstId is null
        and [Id] in(select * from dbo.SplitID(@lstId))))
GO

