IF object_id('[dbo].[Resources_Sp_GetByFilter]') IS NOT NULL
	DROP PROCEDURE [dbo].[Resources_Sp_GetByFilter]
GO
            

CREATE PROCEDURE [dbo].[Resources_Sp_GetByFilter]
(@Culture varchar(10) = null, @Name varchar(50) = null, @IsEntity bit = null, @EntityName varchar(100) = null, @ColumName varchar(100) = null, @RowCodeId varchar(100) = null, @Value varchar(MAX) = null, @Type varchar(50) = null, @Page int = null, @PageSize int = null) 
AS
SET NOCOUNT ON;
SELECT PAG.*, ROW_NUMBER() OVER (ORDER BY PAG.[Id] ASC) AS RowNumber 
INTO #RESUL
FROM dbo.[Resources] AS PAG
WHERE (@Culture is null or [Culture] like @Culture)
	 and (@Name is null or [Name] like @Name)
	 and (@IsEntity is null or [IsEntity] = @IsEntity)
	 and (@EntityName is null or [EntityName] like @EntityName)
	 and (@ColumName is null or [ColumName] like @ColumName)
	 and (@RowCodeId is null or [RowCodeId] like @RowCodeId)
	 and (@Value is null or [Value] like @Value)
	 and (@Type is null or [Type] like @Type)

DECLARE @RowsTotal int
SET @RowsTotal = @@ROWCOUNT

SELECT *, @RowsTotal AS RowsTotal
FROM #RESUL
WHERE @Page is null or (RowNumber > (@Page * @PageSize) - @PageSize and RowNumber <= (@Page * @PageSize))

DROP TABLE #RESUL
GO

IF object_id('[dbo].[Resources_Sp_Save]') IS NOT NULL
	DROP PROCEDURE [dbo].[Resources_Sp_Save]

GO
            
CREATE PROCEDURE [dbo].[Resources_Sp_Save]
(@Id int, @Culture varchar(10), @Name varchar(50), @IsEntity bit, @EntityName varchar(100), @ColumName varchar(100), @RowCodeId varchar(100), @Value varchar(MAX), @Type varchar(50))
as
IF (SELECT COUNT(*) from dbo.[Resources] WHERE ( [Id] = @Id)  ) > 0
    BEGIN
        UPDATE dbo.[Resources]
            SET  [Culture] = @Culture, [Name] = @Name, [IsEntity] = @IsEntity, [EntityName] = @EntityName, [ColumName] = @ColumName, [RowCodeId] = @RowCodeId, [Value] = @Value, [Type] = @Type
            WHERE ( [Id] = @Id)
        SELECT @Id as Id
    END
ELSE
    BEGIN
        
        INSERT INTO dbo.[Resources]   
              ([Culture], [Name], [IsEntity], [EntityName], [ColumName], [RowCodeId], [Value], [Type]) 
       VALUES (@Culture , @Name , @IsEntity , @EntityName , @ColumName , @RowCodeId , @Value , @Type )
        SELECT SCOPE_IDENTITY() as Id
    END

GO

